        "import streamlit as st\n",
        "import pandas as pd\n",
        "from collections import defaultdict\n",
        "\n",
        "################################\n",
        "# Get pairs ranking\n",
        "################################\n",
        "\n",
        "# Function to check if the recommendations of patient_i are a superset of patient_j\n",
        "def is_superset(patient_i, patient_j, columns):\n",
        "    return all(patient_i[col] >= patient_j[col] for col in columns)\n",
        "\n",
        "def is_exactset(patient_i, patient_j, columns):\n",
        "    return all(patient_i[col] == patient_j[col] for col in columns)\n",
        "\n",
        "# Get automatic ranking - identify obvious ranked pairs by definition\n",
        "def identify_aut_ranked_pairs(patient_df, age_col, risk_col, rec_cols, patient_id_col):\n",
        "    aut_ranked_pairs = []\n",
        "    for i in range(len(patient_df)):\n",
        "        for j in range(len(patient_df)):\n",
        "            if i != j:\n",
        "                patient_i = patient_df.iloc[i]\n",
        "                patient_j = patient_df.iloc[j]\n",
        "\n",
        "                # Check if the required conditions are met\n",
        "                if ((patient_i[age_col] <= patient_j[age_col] and patient_i[risk_col] >= patient_j[risk_col] and is_superset(patient_i, patient_j, rec_cols)) and\n",
        "                      not(patient_i[age_col] == patient_j[age_col] and patient_i[risk_col] == patient_j[risk_col] and is_exactset(patient_i, patient_j, rec_cols))):\n",
        "                        aut_ranked_pairs.append(((patient_i[patient_id_col], patient_j[patient_id_col]), 6))  # Confidence level for automatically identified pairs\n",
        "\n",
        "                # If exactly identical insert only once to avoid a loop and set a low confidence\n",
        "                if ((patient_i[age_col] == patient_j[age_col] and patient_i[risk_col] == patient_j[risk_col] and is_exactset(patient_i, patient_j, rec_cols)) and\n",
        "                    patient_i[patient_id_col] < patient_j[patient_id_col]):\n",
        "                        aut_ranked_pairs.append(((patient_i[patient_id_col], patient_j[patient_id_col]), 1))\n",
        "\n",
        "    return aut_ranked_pairs\n",
        "\n",
        "def get_patient_info(patient_id, patient_df, rec_translation_dict, label):\n",
        "    patient_info = patient_df.loc[patient_df['patient_num'] == patient_id].squeeze()\n",
        "    info_str = f\"Patient {label} (random identifier {patient_id}):\\n\"\n",
        "    info_str += f\"Age: {patient_info['age']}, Risk: {patient_info['risk']}, \"\n",
        "    info_str += \"Recommendations:\\n\"\n",
        "    for rec, description in rec_translation_dict.items():\n",
        "        if patient_info[rec] == 1:\n",
        "            info_str += f\"- {description}\\n\"\n",
        "    return info_str\n",
        "\n",
        "def get_pcp_input(candidate_pairs, patient_df, rec_translation_dict, print_flag=False, print_text=\"\"):\n",
        "\n",
        "    pcp_ranked_pairs = []\n",
        "\n",
        "    total_pairs = len(candidate_pairs)\n",
        "    st.write(f\"You will be ranking {total_pairs} pairs of patients.\")\n",
        "\n",
        "    for idx, pair in enumerate(candidate_pairs):\n",
        "        patient_i, patient_j = pair\n",
        "\n",
        "        st.write(f\"\\nPair {idx + 1} of {total_pairs}: \\n\")\n",
        "        st.write(get_patient_info(patient_i, patient_df, rec_translation_dict, label=1))\n",
        "        st.write(get_patient_info(patient_j, patient_df, rec_translation_dict, label=2))\n",
        "        st.write(\"Which patient should be prioritized - 1 or 2?\")\n",
        "\n",
        "        ranking = st.radio(f\"Select the patient to prioritize for pair {idx + 1}:\", (1, 2))\n",
        "\n",
        "        if ranking == 1:\n",
        "            pcp_ranked_pairs.append(((patient_i, patient_j), 0))  # Placeholder for confidence level\n",
        "        elif ranking == 2:\n",
        "            pcp_ranked_pairs.append(((patient_j, patient_i), 0))  # Placeholder for confidence level\n",
        "\n",
        "        # Get confidence level\n",
        "        st.write(\"\\nEnter the confidence level for this choice (1 to 5):\")\n",
        "        st.write(\"5 – completely certain\")\n",
        "        st.write(\"4 – almost certain\")\n",
        "        st.write(\"3 – fairly certain\")\n",
        "        st.write(\"2 – slightly certain\")\n",
        "        st.write(\"1 – not certain (chose because I had to)\")\n",
        "\n",
        "        confidence = st.slider(f\"Confidence level for pair {idx + 1}:\", 1, 5, 3)\n",
        "        pcp_ranked_pairs[-1] = (pcp_ranked_pairs[-1][0], confidence)  # Update the last appended pair with the confidence level\n",
        "\n",
        "    if print_flag:\n",
        "        st.write(print_text)\n",
        "        st.write(\"PCP ranked pairs with confidence levels:\")\n",
        "        st.write(pcp_ranked_pairs)\n",
        "\n",
        "    return pcp_ranked_pairs"
