        "    aggregated_states = []\n",
        "    iteration_num = 0\n",
        "    trn_pcp_ranked_pairs = []\n",
        "    tst_pcp_ranked_pairs = []\n",
        "    trn_llm_ranked_pairs = []\n",
        "    tst_llm_ranked_pairs = []\n",
        "    trn_rankings_df = trn_df[['patient_num']].copy()\n",
        "    tst_rankings_df = tst_df[['patient_num']].copy()\n",
        "    previous_rank_dict = None\n",
        "    stable_iterations = 0\n",
        "    normalized_avg_rank_change = 999\n",
        "else:\n",
        "    # Load saved data\n",
        "    loaded_user_inputs, patient_df, trn_df, tst_df, rec_translation_dict, rec_col_names, \\\n",
        "    trn_aut_ranked_pairs, tst_aut_ranked_pairs, tst_stable_pcp_ranked_pairs, \\\n",
        "    tst_stable_all_ranked_pairs, aggregated_states, ranked_patients_df, \\\n",
        "    predefined_trn_index, predefined_tst_index = load_run_data(user_inputs[\"run_name_load\"])\n",
        "\n",
        "    loaded_user_inputs.update(user_inputs)\n",
        "    user_inputs = loaded_user_inputs\n",
        "\n",
        "    # Restore previous state if continuing\n",
        "    if user_inputs[\"action_choice\"] in ['model_training', 'predefined_pairs', 'augment_stable_test_set']:\n",
        "        iteration_num = get_iteration_num_to_continue(len(aggregated_states))\n",
        "        state = copy.deepcopy(aggregated_states[iteration_num - 1])\n",
        "        aggregated_states = aggregated_states[:iteration_num]\n",
        "        trn_pcp_ranked_pairs = state['trn_pcp_ranked_pairs']\n",
        "        tst_pcp_ranked_pairs = state['tst_pcp_ranked_pairs']\n",
        "        trn_llm_ranked_pairs = state['trn_llm_ranked_pairs']\n",
        "        tst_llm_ranked_pairs = state['tst_llm_ranked_pairs']\n",
        "        trn_rankings_df = state['trn_rankings_df']\n",
        "        tst_rankings_df = state['tst_rankings_df']\n",
        "        previous_rank_dict = state['previous_rank_dict']\n",
        "        stable_iterations = state['stable_iterations']\n",
        "        trn_reduced_graph = state['trn_reduced_graph']\n",
        "        tst_reduced_graph = state['tst_reduced_graph']\n",
        "        trn_ranking_scores = state['trn_ranking_scores']\n",
        "        tst_ranking_scores = state['tst_ranking_scores']\n",
        "\n",
        "# Display patient data\n",
        "st.write(\"### Patient Data Preview\")\n",
        "if user_inputs[\"run_choice\"] == \"new\":\n",
        "    st.write(patient_df.head())\n",
        "\n",
        "# פונקציה לקבלת קלט מהמשתמש\n",
        "def get_user_input(prompt, input_type=int, validation_fn=None, default_value=None):\n",
        "    if input_type == int:\n",
        "        user_input = st.number_input(prompt, value=default_value, step=1)\n",
        "    elif input_type == float:\n",
        "        user_input = st.number_input(prompt, value=default_value)\n",
        "    elif input_type == str:\n",
        "        user_input = st.text_input(prompt, value=default_value)\n",
        "\n",
        "    if validation_fn and not validation_fn(user_input):\n",
        "        st.error(f\"Invalid input. Please enter a valid {input_type.__name__}.\")\n",
        "        return None\n",
        "    return user_input\n",
        "\n",
        "# Handle different action choices\n",
        "if user_inputs[\"action_choice\"] == 'predefined_pairs':\n",
        "    if user_inputs[\"run_choice\"] == 'new':\n",
        "        # Initialize indices for a new run\n",
        "        predefined_trn_index = 0\n",
        "        predefined_tst_index = 0\n",
        "    else:\n",
        "        # Restore previous indices from saved state\n",
        "        iteration_num = get_iteration_num_to_continue(len(aggregated_states))\n",
        "        state = copy.deepcopy(aggregated_states[iteration_num - 1])\n",
        "        aggregated_states = aggregated_states[:iteration_num]\n",
        "\n",
        "        predefined_trn_index = state.get('predefined_trn_index') or 0\n",
        "        predefined_tst_index = state.get('predefined_tst_index') or 0\n",
        "\n",
        "    while True:\n",
        "        # Determine the number of pairs to rank\n",
        "        num_pairs = st.number_input(\n",
        "            \"Enter the total number of pairs you want to rank - choose an even number (0 for default 10): \",\n",
        "            min_value=0, value=10, step=2\n",
        "        )\n",
        "\n",
        "        # Calculate remaining pairs\n",
        "        remaining_trn_pairs = len(trn_pcp_ranked_pairs_predefined) - predefined_trn_index\n",
        "        remaining_tst_pairs = len(tst_pcp_ranked_pairs_predefined) - predefined_tst_index\n",
        "\n",
        "        if remaining_trn_pairs <= 0 and remaining_tst_pairs <= 0:\n",
        "            st.write(\"No more predefined pairs available.\")\n",
        "            break\n",
        "\n",
        "        # Adjust number of pairs if not enough remain\n",
        "        max_pairs_available = remaining_trn_pairs + remaining_tst_pairs\n",
        "        num_pairs = min(num_pairs, max_pairs_available)\n",
        "\n",
        "        # Alternate between train and test pairs\n",
        "        selected_trn_pairs = trn_pcp_ranked_pairs_predefined[predefined_trn_index:predefined_trn_index + min(num_pairs//2, remaining_trn_pairs)]\n",
        "        selected_tst_pairs = tst_pcp_ranked_pairs_predefined[predefined_tst_index:predefined_tst_index + min(num_pairs//2, remaining_tst_pairs)]\n",
        "\n",
        "        combined_pairs = []\n",
        "        trn_idx = 0\n",
        "        tst_idx = 0\n",
        "        for i in range(num_pairs):\n",
        "            if trn_idx < len(selected_trn_pairs):\n",
        "                combined_pairs.append(('train', selected_trn_pairs[trn_idx]))\n",
        "                trn_idx += 1\n",
        "            if tst_idx < len(selected_tst_pairs):\n",
        "                combined_pairs.append(('test', selected_tst_pairs[tst_idx]))\n",
        "                tst_idx += 1\n",
        "            if trn_idx >= len(selected_trn_pairs) and tst_idx >= len(selected_tst_pairs):\n",
        "                break\n",
        "        st.write(f\"After updating: predefined_trn_index = {predefined_trn_index}, predefined_tst_index = {predefined_tst_index}\")\n",
        "        # Limit combined_pairs to the requested number of pairs\n",
        "        combined_pairs = combined_pairs[:num_pairs]\n",
        "\n",
        "        # Update indices\n",
        "        predefined_trn_index += trn_idx\n",
        "        predefined_tst_index += tst_idx\n",
        "\n",
        "        # Collect rankings for combined pairs\n",
        "        new_trn_pcp_ranked_pairs = []\n",
        "        new_tst_pcp_ranked_pairs = []\n",
        "        for idx, (pair_type, pair) in enumerate(combined_pairs):\n",
        "            st.write(f\"\\nPair {idx + 1} of {len(combined_pairs)}:\")\n",
        "\n",
        "            # Determine which dataframe and list to use\n",
        "            if pair_type == 'train':\n",
        "                df = trn_df\n",
        "                new_pairs_list = new_trn_pcp_ranked_pairs\n",
        "            else:  # 'test'\n",
        "                df = tst_df\n",
        "                new_pairs_list = new_tst_pcp_ranked_pairs\n",
        "\n",
        "            # Display patient information\n",
        "            st.write(get_patient_info(pair[0], df, rec_translation_dict, label=1))\n",
        "            st.write(get_patient_info(pair[1], df, rec_translation_dict, label=2))\n",
        "\n",
        "            # Collect user input\n",
        "            ranking = st.radio(f\"Which patient should be prioritized for pair {idx + 1}?\", (1, 2))\n",
        "            confidence = st.slider(f\"Enter your confidence level for pair {idx + 1} (1-5): \", 1, 5, 3)\n",
        "\n",
        "            # Append the ranked pair with confidence\n",
        "            if ranking == 1:\n",
        "                new_pairs_list.append(((pair[0], pair[1]), confidence))\n",
        "            else:\n",
        "                new_pairs_list.append(((pair[1], pair[0]), confidence))\n",
        "\n",
        "        # Update ranked pairs lists\n",
        "        trn_pcp_ranked_pairs += new_trn_pcp_ranked_pairs\n",
        "        tst_pcp_ranked_pairs += new_tst_pcp_ranked_pairs\n",
        "\n",
        "        # Ask the user if they want to continue ranking more pairs\n",
        "        continue_ranking = st.radio(\n",
        "            \"Do you want to rank more pairs?\",\n",
        "            (1, 2),\n",
        "            format_func=lambda x: \"Yes\" if x == 1 else \"No\"\n",
        "        )\n",
        "        if continue_ranking == 2:\n",
        "            break\n",
        "\n",
        "    # Combine all ranked pairs\n",
        "    trn_all_ranked_pairs = trn_aut_ranked_pairs + trn_pcp_ranked_pairs\n",
        "    tst_all_ranked_pairs = tst_aut_ranked_pairs + tst_pcp_ranked_pairs\n",
        "    user_ranked_pairs = trn_pcp_ranked_pairs + tst_pcp_ranked_pairs\n",
        "\n",
        "    import streamlit as st\n",
        "\n",
        "    # Build graphs and reduced graphs\n",
        "    if sw_qa_prints_some:\n",
        "        st.write(\"\\nCurrent data regarding ranked TRAIN pairs\\n-----------------------------------------\")\n",
        "    if sw_qa_prints_all:\n",
        "        st.write(\"All automatic train ranked pairs:\\n\", trn_aut_ranked_pairs)\n",
        "        st.write(\"All current PCP train ranked pairs:\\n\", trn_pcp_ranked_pairs)\n",
        "        st.write(\"All current train ranked pairs:\\n\", trn_all_ranked_pairs)\n",
        "    trn_graph = build_graph(trn_all_ranked_pairs, print_flag=sw_qa_prints_all, print_text=\"Train graph:\")\n",
        "    trn_reduced_graph = transitive_reduction(trn_graph, print_flag=sw_qa_prints_some, print_text=\"Train reduced graph:\")\n",
        "    trn_reduced_ranked_pairs = extract_ranked_pairs(trn_reduced_graph, print_flag=sw_qa_prints_some, print_text=\"Train reduced ranked pairs:\")\n",
        "\n",
        "    if sw_qa_prints_some:\n",
        "        st.write(\"\\nCurrent data regarding ranked TEST pairs\\n-----------------------------------------\")\n",
        "    if sw_qa_prints_all:\n",
        "        st.write(\"All automatic test ranked pairs:\\n\", tst_aut_ranked_pairs)\n",
        "        st.write(\"All current PCP test ranked pairs:\\n\", tst_pcp_ranked_pairs)\n",
        "        st.write(\"All current test ranked pairs:\\n\", tst_all_ranked_pairs)\n",
        "    tst_graph = build_graph(tst_all_ranked_pairs, print_flag=sw_qa_prints_all, print_text=\"Test graph:\")\n",
        "    tst_reduced_graph = transitive_reduction(tst_graph, print_flag=sw_qa_prints_some, print_text=\"Test reduced graph:\")\n",
        "    tst_reduced_ranked_pairs = extract_ranked_pairs(tst_reduced_graph, print_flag=sw_qa_prints_some, print_text=\"Test reduced ranked pairs:\")\n",
        "\n",
        "    # Train the model\n",
        "    st.write(\"\\nTraining the model with predefined pairs\\n-----------------------------------------\")\n",
        "    set_seed(1234)\n",
        "    dataset = PairwiseDatasetWithConfidence(trn_all_ranked_pairs, trn_df)\n",
        "    dataloader = DataLoader(dataset, batch_size=32, shuffle=True)\n",
        "    input_dim = trn_df.shape[1] - 1\n",
        "    model = RankNet(input_dim)\n",
        "    criterion = nn.BCEWithLogitsLoss()\n",
        "    optimizer = optim.Adam(model.parameters(), lr=0.005)\n",
        "    train_model(model, dataloader, criterion, optimizer, num_epochs=50, patience=10, min_delta=0.001, print_flag=sw_qa_prints_all)\n",
        "\n",
        "    # Get rankings\n",
        "    trn_ranking_scores = predict_ranking_scores(model, trn_df)\n",
        "    tst_ranking_scores = predict_ranking_scores(model, tst_df)\n",
        "\n",
        "    # Update rankings dataframes\n",
        "    trn_rankings_df = update_rankings_df(trn_rankings_df, trn_ranking_scores, iteration_num)\n",
        "    trn_rankings_df_formated = create_formatted_rankings_df(trn_rankings_df)\n",
        "    if sw_qa_prints_all:\n",
        "        st.write(\"\\nCumulative TRAIN patients rankings\\n\", trn_rankings_df_formated)\n",
        "\n",
        "    tst_rankings_df = update_rankings_df(tst_rankings_df, tst_ranking_scores, iteration_num)\n",
        "    tst_rankings_df_formated = create_formatted_rankings_df(tst_rankings_df)\n",
        "    if sw_qa_prints_all:\n",
        "        st.write(\"\\nCumulative TEST patients rankings\\n\", tst_rankings_df_formated)\n",
        "\n",
        "    # Calculate metrics\n",
        "    if sw_qa_prints_some:\n",
        "        st.write(\"\\nModel performance\\n-----------------------------------------\")\n",
        "    trn_metrics_dynamic_pairs = bootstrap_metrics(trn_ranking_scores, trn_all_ranked_pairs, num_bootstraps=500, print_flag=sw_qa_prints_some, print_title=\"\\nModel performance for TRAIN pairs:\")\n",
        "    tst_metrics_dynamic_pairs = bootstrap_metrics(tst_ranking_scores, tst_all_ranked_pairs, num_bootstraps=500, print_flag=sw_qa_prints_some, print_title=\"\\nModel performance for TEST pairs:\")\n",
        "\n",
        "    # Generate ranked patients Excel file\n",
        "    st.write(\"\\nGenerating ranked patients Excel file and explainability plots\\n-----------------------------------------\")\n",
        "    ranked_patients_df = get_ranked_patients_df(tst_df, tst_ranking_scores, rec_translation_dict, user_inputs[\"run_name_save\"])\n",
        "\n",
        "    # Generate explainability plots and save\n",
        "    generate_surrogate_model_and_save(model, tst_df, tst_ranking_scores, rec_translation_dict, run_name=user_inputs[\"run_name_save\"])\n",
        "\n",
        "    # choosing not to stop\n",
        "    normalized_avg_rank_change = 999\n",
        "    # Save the current state\n",
        "    aggregated_states = append_current_state(\n",
        "        aggregated_states=copy.deepcopy(aggregated_states),\n",
        "        iteration_num=iteration_num,\n",
        "        normalized_avg_rank_change=normalized_avg_rank_change,\n",
        "        stable_iterations=stable_iterations,\n",
        "        previous_rank_dict=copy.deepcopy(previous_rank_dict),\n",
        "        trn_pcp_ranked_pairs=copy.deepcopy(trn_pcp_ranked_pairs),\n",
        "        trn_llm_ranked_pairs=copy.deepcopy(trn_llm_ranked_pairs),\n",
        "        trn_all_ranked_pairs=copy.deepcopy(trn_all_ranked_pairs),\n",
        "        trn_graph=copy.deepcopy(trn_graph),\n",
        "        trn_reduced_graph=copy.deepcopy(trn_reduced_graph),\n",
        "        trn_reduced_ranked_pairs=copy.deepcopy(trn_reduced_ranked_pairs),\n",
        "        tst_pcp_ranked_pairs=copy.deepcopy(tst_pcp_ranked_pairs),\n",
        "        tst_llm_ranked_pairs=copy.deepcopy(tst_llm_ranked_pairs),\n",
        "        tst_all_ranked_pairs=copy.deepcopy(tst_all_ranked_pairs),\n",
        "        tst_graph=copy.deepcopy(tst_graph),\n",
        "        tst_reduced_graph=copy.deepcopy(tst_reduced_graph),\n",
        "        tst_reduced_ranked_pairs=copy.deepcopy(tst_reduced_ranked_pairs),\n",
        "        trn_ranking_scores=copy.deepcopy(trn_ranking_scores),\n",
        "        trn_rankings_df=copy.deepcopy(trn_rankings_df),\n",
        "        trn_rankings_df_formated=copy.deepcopy(trn_rankings_df_formated),\n",
        "        tst_ranking_scores=copy.deepcopy(tst_ranking_scores),\n",
        "        tst_rankings_df=copy.deepcopy(tst_rankings_df),\n",
        "        tst_rankings_df_formated=copy.deepcopy(tst_rankings_df_formated),\n",
        "        model=copy.deepcopy(model),\n",
        "        trn_metrics_dynamic_pairs=copy.deepcopy(trn_metrics_dynamic_pairs),\n",
        "        tst_metrics_dynamic_pairs=copy.deepcopy(tst_metrics_dynamic_pairs),\n",
        "        num_trn_pairs=len(trn_all_ranked_pairs),\n",
        "        num_tst_pairs=len(tst_all_ranked_pairs),\n",
        "        num_tst_stable_pairs=0,\n",
        "        trn_metrics_dynamic_batch_size=None,  # אם יש לך ערכים ספציפיים להעביר, העבר אותם כאן\n",
        "        tst_metrics_dynamic_batch_size=None,\n",
        "        tst_metrics_stable_batch_size=None,\n",
        "        predefined_trn_index=copy.deepcopy(predefined_trn_index),\n",
        "        predefined_tst_index=copy.deepcopy(predefined_tst_index),\n",
        "        tst_metrics_stable_pairs=copy.deepcopy([]))\n",
        "\n",
        "    # Save results\n",
        "    st.write(\"\\nSaving current state\\n-----------------------------------------\")\n",
        "    st.write(user_inputs[\"run_name_save\"])\n",
        "    save_run_data(user_inputs[\"run_name_save\"], user_inputs, patient_df, trn_df, tst_df,\n",
        "                  rec_translation_dict, rec_col_names, trn_aut_ranked_pairs, tst_aut_ranked_pairs,\n",
        "                  tst_stable_pcp_ranked_pairs, tst_stable_all_ranked_pairs, aggregated_states, ranked_patients_df, predefined_trn_index, predefined_tst_index)\n",
        "\n",
        "elif user_inputs[\"action_choice\"] == 'augment_stable_test_set':\n",
        "    # Handle 'augment_stable_test_set' option\n",
        "    # ---------------------------------------\n",
        "    if sw_qa_prints_some:\n",
        "        print(\"\\nCurrent data regarding ranked STABLE TEST pairs\\n-----------------------------------------\")\n",
        "    if sw_qa_prints_all:\n",
        "        print(\"All automatic test ranked pairs:\\n\", tst_aut_ranked_pairs)\n",
        "        print(\"All current PCP STABLE test ranked pairs:\\n\", tst_stable_pcp_ranked_pairs)\n",
        "        print(\"All current STABLE test ranked pairs:\\n\", tst_stable_all_ranked_pairs)\n",
        "    tst_stable_graph = build_graph(tst_stable_all_ranked_pairs, print_flag=sw_qa_prints_all, print_text=\"Test STABLE graph:\")\n",
        "    tst_stable_reduced_graph = transitive_reduction(tst_stable_graph, print_flag=sw_qa_prints_some, print_text=\"Test STABLE reduced graph:\")\n",
        "\n",
        "    if sw_qa_prints_all:\n",
        "        print(\"\\nIdentifying new pairs for ranking for the STABLE TEST set\\n-----------------------------------------\")\n",
        "    tst_candidate_pairs = identify_candidate_pairs_for_stable_set(tst_stable_reduced_graph, tst_df, print_flag=sw_qa_prints_all, print_text=\"Test STABLE \")\n",
        "\n",
        "    print(\"\\nGetting PCP input for the STABLE test set:\\n-----------------------------------------\")\n",
        "    new_tst_stable_pcp_ranked_pairs = get_pcp_input(tst_candidate_pairs, tst_df, rec_translation_dict, print_flag=sw_qa_prints_all, print_text=\"\\nTest STABLE PCP Input: \")\n",
        "    tst_stable_pcp_ranked_pairs += new_tst_stable_pcp_ranked_pairs\n",
        "    tst_stable_all_ranked_pairs = tst_aut_ranked_pairs + tst_stable_pcp_ranked_pairs\n",
        "\n",
        "    # Save the current run\n",
        "    print(\"\\nSaving current state\\n-----------------------------------------\")\n",
        "    print(user_inputs[\"run_name_save\"])\n",
        "    save_run_data(user_inputs[\"run_name_save\"], user_inputs, patient_df, trn_df, tst_df,\n",
        "                  rec_translation_dict, rec_col_names, trn_aut_ranked_pairs, tst_aut_ranked_pairs,\n",
        "                  tst_stable_pcp_ranked_pairs, tst_stable_all_ranked_pairs, aggregated_states, tst_rankings_df,predefined_trn_index, predefined_tst_index)\n",
        "\n",
        "elif user_inputs[\"action_choice\"] == 'model_training':\n",
        "    # Handle 'model_training' option\n",
        "    # ------------------------------\n",
        "    # Starting the active learning loop\n",
        "    while True:\n",
        "\n",
        "        print(\"\\n========================\")\n",
        "        print(\"Active learning iteration:\", iteration_num)\n",
        "        print(\"========================\")\n",
        "\n",
        "        set_seed(1234)\n",
        "        if iteration_num > 0:\n",
        "            # Identify new pairs for ranking\n",
        "            if sw_qa_prints_all:\n",
        "                print(\"\\nIdentifying new pairs for ranking for the TRAIN set\\n-----------------------------------------\")\n",
        "            trn_candidate_pairs = identify_candidate_pairs_for_learning_iterations(trn_reduced_graph, trn_ranking_scores, print_flag=sw_qa_prints_all, print_text=\"Train \", num_pairs=user_inputs[\"pcp_input_pairs_per_iteration\"])\n",
        "            if sw_qa_prints_all:\n",
        "                print(\"\\nIdentifying new pairs for ranking for the TEST set\\n-----------------------------------------\")\n",
        "            tst_candidate_pairs = identify_candidate_pairs_for_learning_iterations(tst_reduced_graph, tst_ranking_scores, print_flag=sw_qa_prints_all, print_text=\"Test \", num_pairs=user_inputs[\"pcp_input_pairs_per_iteration\"])\n",
        "\n",
        "            # Get new ranking from PCPs\n",
        "            print(\"\\nGetting PCP input for candidate pairs (train set):\\n-----------------------------------------\")\n",
        "            new_trn_pcp_ranked_pairs = get_pcp_input(trn_candidate_pairs, trn_df, rec_translation_dict, print_flag=sw_qa_prints_all, print_text=\"\\nTrain PCP Input: \")\n",
        "            trn_pcp_ranked_pairs += new_trn_pcp_ranked_pairs\n",
        "\n",
        "            print(\"\\nGetting PCP input for candidate pairs (test set):\\n-----------------------------------------\")\n",
        "            new_tst_pcp_ranked_pairs = get_pcp_input(tst_candidate_pairs, tst_df, rec_translation_dict, print_flag=sw_qa_prints_all, print_text=\"\\nTest PCP Input: \")\n",
        "            tst_pcp_ranked_pairs += new_tst_pcp_ranked_pairs\n",
        "\n",
        "        # Updating a list of ranked pairs from all sources and creating a reduced set of ranked pairs\n",
        "        trn_all_ranked_pairs = trn_aut_ranked_pairs + trn_pcp_ranked_pairs + trn_llm_ranked_pairs\n",
        "        tst_all_ranked_pairs = tst_aut_ranked_pairs + tst_pcp_ranked_pairs + tst_llm_ranked_pairs\n",
        "\n",
        "        # Build graphs\n",
        "        if sw_qa_prints_some:\n",
        "            print(\"\\nCurrent data regarding ranked TRAIN pairs\\n-----------------------------------------\")\n",
        "        if sw_qa_prints_all:\n",
