        "            continue_choice = st.radio(\"\\nDo you want to continue the learning iterations for now? (1 for continue, 2 for stop): \", (1, 2), format_func=lambda x: \"Continue\" if x == 1 else \"Stop\")\n",
        "            if continue_choice == 2:\n",
        "                st.write(\"User chose to stop the iterations.\")\n",
        "                break\n",
        "            else:\n",
        "                # Continue the loop\n",
        "                 st.session_state.iteration_num += 1\n",
        "        else:\n",
        "            # Non-interactive environment: add a timeout or default behavior\n",
        "            st.write(\"Non-interactive environment detected. Stopping the loop.\")\n",
        "            break\n",
        "\n",
        "\n",
        "        st.session_state.iteration_num += 1 #hoping it doesnt cause an error'''\n",
        "\n",
        "    # End active learning loop\n",
        "\n",
        "    # Print the final ranking of the test set and explainability plots\n",
