        "                  trn_aut_ranked_pairs, tst_aut_ranked_pairs, tst_stable_pcp_ranked_pairs, tst_stable_all_ranked_pairs,\n",
        "                  aggregated_states, ranked_patients_df, predefined_trn_index, predefined_tst_index)\n",
        "\n",
        "    generate_surrogate_model_and_save(model, tst_df, tst_ranking_scores, rec_translation_dict, run_name=user_inputs[\"run_name_save\"])\n",
