        "#Normalized Discounted Cumulative Gain (NDCG):\n",
        "!pip install rbo\n",
        "!pip install statsmodels\n",
        "from sklearn.metrics import ndcg_score\n",
        "import rbo\n",
        "import pandas as pd\n",
        "from sklearn.metrics import ndcg_score\n",
        "from scipy.stats import kendalltau\n",
        "from scipy.stats import spearmanr\n",
        "import numpy as np\n",
        "from scipy.stats import weightedtau, spearmanr, rankdata\n",
        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "\n",
        "# פונקציה לטעינת קובץ CSV ויצירת רשימה מהעמודות הרצויות\n",
        "def load_rankings(file_path, rank_column, id_column):\n",
        "    df = pd.read_csv(file_path)\n",
        "    df = df[[id_column, rank_column]].dropna()\n",
        "    min_rank = df[rank_column].min()\n",
        "    df[rank_column] = df[rank_column] + abs(min_rank) + 1\n",
        "    return df.set_index(id_column)[rank_column].to_dict()\n",
        "\n",
        "# פונקציה לחישוב NDCG בין שתי רשימות דירוג\n",
        "def calculate_ndcg(file1, file2, rank_column, id_column):\n",
        "    # טעינת הדירוגים משני הקבצים\n",
        "    rankings1 = load_rankings(file1, rank_column, id_column)\n",
        "    rankings2 = load_rankings(file2, rank_column, id_column)\n",
        "    #print(rankings1)\n",
        "    #print(rankings2)\n",
        "    # מציאת המטופלים המשותפים לשתי הרשימות\n",
        "    common_ids = list(set(rankings1.keys()) & set(rankings2.keys()))\n",
        "    #print(len(common_ids))\n",
        "    #print('common_ids')\n",
        "    # יצירת רשימות הדירוג עבור המטופלים המשותפים\n",
        "    y_true = [rankings1[id_] for id_ in common_ids]\n",
        "    y_score = [rankings2[id_] for id_ in common_ids]\n",
        "\n",
        "    # חישוב NDCG\n",
        "    ndcg = ndcg_score([y_true], [y_score])\n",
        "    print(f\"NDCG between the two rankings: {ndcg:.4f}\")\n",
        "\n",
        "    #חישוב RBO\n",
        "    # rbo_ext calculates the RBO and returns a tuple where the first element is the RBO score\n",
        "    ranked_list1 = [k for k, v in sorted(rankings1.items(), key=lambda item: item[1])]\n",
        "    ranked_list2 = [k for k, v in sorted(rankings2.items(), key=lambda item: item[1])]\n",
        "    #print(ranked_list1)\n",
        "    #print(ranked_list2)\n",
        "    rbo_calculator = rbo.RankingSimilarity(ranked_list1, ranked_list2)\n",
        "    rbo_score = rbo_calculator.rbo()\n",
        "    print(f\"RBO Score: {rbo_score:.4f}\")\n",
        "\n",
        "    #kendall's tau\n",
        "    tau, p_value = kendalltau(ranked_list1, ranked_list2)\n",
        "    print(f\"Kendall's Tau: {tau:.4f}\")\n",
        "\n",
        "    #Weighted Kendall's Tau\n",
        "    tau, p_value = weightedtau(ranked_list1, ranked_list2)\n",
        "    print(f\"Weighted Kendall's Tau: {tau:.4f}\")\n",
        "    print(f\"P-value: {p_value:.4f}\")\n",
        "\n",
        "    #Spearman's Rank\n",
        "    rho, p_value = spearmanr(ranked_list1, ranked_list2)\n",
        "    print(f\"Spearman's Rank Correlation: {rho:.4f}\")\n",
        "    #Jaccard#not relevant\n",
        "    intersection = len(set(ranked_list1).intersection(set(ranked_list2)))\n",
        "    union = len(set(ranked_list1).union(set(ranked_list2)))\n",
        "    jaccard_index= intersection / union\n",
        "    #jaccard =jaccard_index(set(ranked_list1),set(ranked_list2))\n",
        "    print(f\"Jaccard_Index: {jaccard_index:.4f}\")\n",
        "\n",
        "    #top 10 k\n",
        "    # Get the top K patient IDs from both rankings\n",
        "    k=10\n",
        "    top_k_1 = set(ranked_list1[:k])\n",
        "    top_k_2 = set(ranked_list2[:k])\n",
        "    # Find the intersection of the top K patient IDs\n",
        "    common_ids = top_k_1.intersection(top_k_2)\n",
        "    # Calculate the precision\n",
        "    precision = len(common_ids) / k\n",
        "    print(f\"Top-{k} Precision: {precision:.4f}\")\n",
        "    print(f\"Common IDs in Top-{k}: {common_ids}\")\n",
        "\n",
        "    #top 20 k\n",
        "    # Get the top K patient IDs from both rankings\n",
        "    k=20\n",
        "    top_k_1 = set(ranked_list1[:k])\n",
        "    top_k_2 = set(ranked_list2[:k])\n",
        "    # Find the intersection of the top K patient IDs\n",
        "    common_ids = top_k_1.intersection(top_k_2)\n",
        "    # Calculate the precision\n",
        "    precision = len(common_ids) / k\n",
        "    print(f\"Top-{k} Precision: {precision:.4f}\")\n",
        "    print(f\"Common IDs in Top-{k}: {common_ids}\")\n",
        "\n",
        "    #plot dislacement\n",
        "\n",
        "    # Calculate rank displacement\n",
        "    df = pd.DataFrame({\n",
        "    'Patient': ranked_list1,\n",
        "    'Rank1': range(1, len(ranked_list1) + 1),\n",
        "    'Rank2': [ranked_list2.index(p) + 1 for p in ranked_list1]})\n",
        "    df['Displacement'] = df['Rank1'] - df['Rank2']\n",
        "    # Sort by displacement to see the biggest changes\n",
        "    df_sorted = df.sort_values(by='Displacement', key=abs, ascending=False)\n",
        "    # Display the DataFrame\n",
        "    #print(df_sorted)\n",
        "    # Plot the displacement\n",
        "    plt.figure(figsize=(10, 6))\n",
        "    plt.bar(df['Patient'], df['Displacement'], color='blue')\n",
        "    plt.axhline(0, color='red', linestyle='--')\n",
        "    plt.xlabel('Patient ID')\n",
        "    plt.ylabel('Rank Displacement')\n",
        "    plt.title('Rank Displacement Analysis')\n",
        "    plt.show()\n",
        "\n",
        "\n",
        "# קבצי ה-CSV שלך והעמודות המתאימות\n",
        "maya_ranking = \"test_run_20240615_26_trn_ranked_patients.csv\"\n",
