        "import matplotlib.pyplot as plt\n",
        "import networkx as nx\n",
        "\n",
        "# יצירת גרף מכוון\n",
        "G = nx.DiGraph()\n",
        "\n",
        "# הוספת קשתות (קשרים) לגרף על בסיס הזוגות של התיעדופים\n",
        "for a, b in pairs:\n",
        "    G.add_edge(a, b)\n",
        "\n",
        "# הבלטת השרשראות הארוכות ביותר:\n",
        "longest_start_patient = df_results.loc[df_results['longest_chain_start'].idxmax()]['patient_num']\n",
        "longest_end_patient = df_results.loc[df_results['longest_chain_end'].idxmax()]['patient_num']\n",
        "\n",
        "# ציור הגרף\n",
        "plt.figure(figsize=(12, 8))\n",
        "\n",
        "# הוספת קשרים לגרף\n",
        "pos = nx.spring_layout(G, seed=42)\n",
        "nx.draw(G, pos, with_labels=True, node_color='lightblue', node_size=500, font_size=10, font_weight='bold', edge_color='gray')\n",
