        "# הבלטת השרשרת הארוכה שמתחילה במטופל\n",
        "nx.draw_networkx_nodes(G, pos, nodelist=[longest_start_patient], node_color='green', node_size=800)\n",
        "nx.draw_networkx_nodes(G, pos, nodelist=[longest_end_patient], node_color='red', node_size=800)\n",
